import React from "react";
import { CFooter } from "@coreui/react";

const TheFooter = () => {
  return (
    <CFooter fixed={false}>
      <div>
        <span className="ml-1" href="http://www.focusappliedtechnologies.com/">Focus Applied Technologies</span>
      </div>
      <div className="mfs-auto">
        <span className="mr-1">Powered by</span>
        <a
          href="https://soundcloud.com/talalqureshi/paisa-feat-hasan-raheem"
          target="_blank"
          rel="noopener noreferrer"
        >
          Good Music
        </a>
      </div>
    </CFooter>
  );
};

export default React.memo(TheFooter);
